function events() {
    var keys = Object.keys(this.metamodel()),
    item = '',
    result = [],
    i = 0,
    length = 0;

    length = keys.length;

    for (i = 0; i < length; i++) {
        item = keys[i];
        if (this.metamodel()[item] === 'event') {
            result.push(item);
        }
    } 
    return result;
}
